pragma solidity ^0.4.24;

import "../lib/PublicResolver.sol";

/**
 * A resolver managed by Komgo with technical meta-data of a company.
 */
contract KomgoMetaResolver is PublicResolver {

    bytes4 constant GUID_INTERFACE_ID = 0xae753d32;
    bytes4 constant LEGAL_ENTITY_NAME_INTERFACE_ID = 0x0b587e38;
    bytes4 constant AMQP_QUEUE_INTERFACE_ID = 0x569b09b4;

    event GuidChanged(bytes32 indexed _node, string _guid);
    event LegalEntityNameChanged(bytes32 indexed _node, string _legalEntityName);
    event AmqpQueueChanged(bytes32 indexed _node, string _amqpQueue);

    struct MetaRecord {
        string guid;
        string legalEntityName;
        string amqpQueue;
    }

    mapping (bytes32 => MetaRecord) metaRecords;

    constructor(ENS _ensAddr) PublicResolver(_ensAddr) public {}

    /**
     * Sets the GUID issued by Komgo.
     * May only be called by the owner of that node in the ENS registry (which is going to be Komgo).
     * @param _node The node to update.
     * @param _guid The GUID to set.
     */
    function setGuid(bytes32 _node, string _guid) public only_owner(_node) {
        metaRecords[_node].guid = _guid;
        emit GuidChanged(_node, _guid);
    }

    /**
     * Sets the legal entity name of a company.
     * May only be called by the owner of that node in the ENS registry (which is going to be Komgo).
     * @param _node The node to update.
     * @param _legalEntityName The legal entity name to set.
     */
    function setLegalEntityName(bytes32 _node, string _legalEntityName) public only_owner(_node) {
        metaRecords[_node].legalEntityName = _legalEntityName;
        emit LegalEntityNameChanged(_node, _legalEntityName);
    }

    /**
     * Sets the AMQP queue of a company.
     * May only be called by the owner of that node in the ENS registry (which is going to be Komgo).
     * @param _node The node to update.
     * @param _amqpQueue The AMQP queue to set.
     */
    function setAmqpQueue(bytes32 _node, string _amqpQueue) public only_owner(_node) {
        metaRecords[_node].amqpQueue = _amqpQueue;
        emit AmqpQueueChanged(_node, _amqpQueue);
    }

    /**
     * Returns the GUID associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated GUID
     */
    function guid(bytes32 _node) public view returns (string) {
        return metaRecords[_node].guid;
    }

    /**
     * Returns the legal entity name associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated legal entity name.
     */
    function legalEntityName(bytes32 _node) public view returns (string) {
        return metaRecords[_node].legalEntityName;
    }

    /**
     * Returns the AMQP queue associated with an ENS node.
     * @param _node The ENS node to query.
     * @return The associated AMQP queue.
     */
    function amqpQueue(bytes32 _node) public view returns (string) {
        return metaRecords[_node].amqpQueue;
    }

    /**
     * Returns true if the resolver implements the interface specified by the provided hash.
     * @param _interfaceID The ID of the interface to check for.
     * @return True if the contract implements the requested interface.
     */
    function supportsInterface(bytes4 _interfaceID) public pure returns (bool) {
        return super.supportsInterface(_interfaceID)
        || _interfaceID == GUID_INTERFACE_ID
        || _interfaceID == LEGAL_ENTITY_NAME_INTERFACE_ID
        || _interfaceID == AMQP_QUEUE_INTERFACE_ID;
    }
}

